import React from 'react'
import { useHistory } from 'react-router-dom'

export function FavoritePreview({ video, setCurrVideo, deleteFromList }) {
    const history = useHistory()

    function playCurrVideo(ev, video) {
        setCurrVideo(ev, video)
        history.push('/play')
    }
    return (
        <div

            className="favorite-preview flex">
            <img className="video-img" src={video.snippet.thumbnails.medium.url} alt="img-video" />
            <div className="video-content flex column">
                <h4>{video.snippet.title}</h4>
                <p>{video.snippet.description}</p>
            </div>
            <div className="btn-div">
                <button onClick={(ev) => deleteFromList(ev, video)}>Delete</button>
                <button onClick={(ev) => playCurrVideo(ev, video)}>Play</button>
            </div>
        </div>
    )
}
